INSERT INTO `fg_settings` VALUES (1, '<br /><p>&nbsp;</p>', '0', '<strong>1967</strong><br />eine gruppe von renommierten modefotografen gr&uuml;nden eine genossenschaft zwecks vermittlung und aufbau von fotomodellen. der name der firma entsteht durch die abk&uuml;rzung von &bdquo;<strong>FOTO</strong>grafen-<strong>GEN</strong>ossenschaft.<br /> <br /><strong>1979</strong><br />die genossenschaft wird in eine aktiengesellschaft umgewandelt - fotogen ag.<br /> <br /><strong>1994</strong><br />face2face, eine bestehende firma, die in der vermittlung von haar, make-up und styling artisten t&auml;tig ist, wird aufgekauft, und der bisherigen t&auml;tigkeit der fotogen hinzugef&uuml;gt. <div>neue artisten werden innerhlab der schweiz entdeckt und aufgebaut. </div><div>renommierte und international annerkannte make up und hair artisten werden ebenfalls aufgenommen und vermittelt.<br /> <br /><strong>2000</strong><br />fotogen entertainment wird ins leben gerufen. diese abteilung ist f&uuml;r die durchf&uuml;hrung innovativer events, sowie die erstellung kundenorientierter konzepte zust&auml;ndig. eigene modellwettbewerbe und events werden in zukunft durch diese abteilung geplant und organisiert.<br /> <br /><strong>2004</strong><br />immer h&auml;ufiger werden authentische modelle in der werbung eingesetzt. um die erweiterung unseres angebotes zu gew&auml;hrleisten, wird face2face in eine &quot;talent&quot; abteilung umgewandelt. diese setzt sich mit der vermittlung von &bdquo;people modellen&ldquo; auseinander. eine eigene webseite wird online geschaltet www.face-face.ch<br /> <br /><strong>2007</strong><br />fotogen feiert das 40 j&auml;hrige bestehen.<br /> <br />  <br /> <br />fotogen ist heute eine der f&uuml;hrenden agenturen der schweiz und z&auml;hlt international zu den renommiertesten internationalen modellagenturen.<br /> <br /> <br /> <br /> <br /> <br /> <br /></div>', '<p><strong>fotogen modells</strong><br />die modellagentur fotogen vermittelt von der schweiz aus nationale und internationale fotomodelle weltweit. seit 1967 bauen wir unseren kundenstamm laufend aus und sind &uuml;ber die jahre zu einer weltweit anerkannten und renommierten adresse f&uuml;r modellanfragen geworden. unsere zahlreichen abteilungen k&ouml;nnen einer breiten palette von anfragen mit den jeweils bestm&ouml;glichen l&ouml;sungsvorschl&auml;gen begegnen.</p><p>&nbsp;</p><p><strong>face2face</strong><br />unsere neu er&ouml;ffnete talent abteilung unter face2face deckt vielseitige kundenbed&uuml;rfnisse in bezug auf people modelle in allen bereichen wie werbung, mode, fotografie und promotion (hostessen) ab. aufgrund der zahlreichen bewerbungen, die wir tagt&auml;glich erhalten, k&ouml;nnen wir unsere kartei ohne grossen aufwand laufend erg&auml;nzen und ein &auml;usserst breites spektrum an gesichtern anbieten. . </p><p><strong>events</strong> </p><p>unsere eventabteilung plant und organisiert in der ganzen schweiz events, allerdings ausschliesslich in den bereichen mode und entertainment.unsere langj&auml;hrige erfahrung erm&ouml;glicht es uns, umwerfende parties und unvergessliche modeschauen auf die beine zu stellen.</p><p>&nbsp;</p><p><strong>fotogen casting/scouting</strong><br />wir sind in der lage auf jedem kontinent castings zu organisieren und haben scouts, die in beinahe allen l&auml;ndern f&uuml;r uns nach neuen gesichtern ausschau halten. schweizer models werden bei uns von grund auf eingearbeitet, aufgebaut und betreut. </p>', '<p><strong>GESCH&Auml;FTSBEDINGUNGEN</strong></p><br />die nachfolgenden bestimmungen sollen die rechtsbeziehungen zwischen den fotomodellen und jeweiligen kunden verbindlich regeln, soweit im einzelfall nicht ausdr&uuml;cklich abweichende vereinbarungen getroffen werden. die agentur gilt als vermittler im sinne des schweizerischen arbeitsvermittlungsgesetzes.<strong><br /><br />grundlagen</strong><br />1. die agentur gibt erkl&auml;rungen gegen&uuml;ber dem kunden im namen und im auftrag des fotomodells ab. als kunde gilt derjenige, der bei der agentur bucht, soweit nicht ausdr&uuml;cklich bei der buchung etwas anderes schriftlich vereinbart wird. der kunde ist verantwortlich f&uuml;r den ordnungsgem&auml;&szlig;en ablauf der buchung sowie deren bezahlung.<br /><br />2.der kunde schuldet der agentur die vermittlungsprovision. diese ist bestandteil der in der buchungsbest&auml;tigung genannten honorarsumme. die agentur erh&auml;lt ebenfalls eine vermittlungsprovision vom modell und kommt f&uuml;r die sozialleistungen und allf&auml;lligen steuern auf. jegliche haftung der agentur aus dem vermittelten rechtsverh&auml;ltnis ist ausgeschlossen. der kunde ist nicht berechtigt, forderungen gegen das fotomodell mit dem provisionsanspruch der agentur aufzurechnen oder ein zur&uuml;ckbehaltungsrecht geltend zu machen.<br /><br />3. der kunde schuldet die vermittlungsprovision auch f&uuml;r folgebuchungen, solange das fotomodell sich von der agentur vertreten l&auml;&szlig;t.<p>&nbsp;</p><p>&nbsp;</p><p><strong>Optionen</strong><br />1. sind terminverbindliche reservierungen. eine option verf&auml;llt, wenn nicht sp&auml;testens drei werktage (bis 18.00 uhr) vor t&auml;tigkeitsbeginn oder innerhalb von einem werktag nach aufforderung durch die agentur eine festbuchung erfolgt. samstag und sonntag sind keine werktage. es gilt zentraleurop&auml;ische zeitrechnung. optionen werden nach buchungseingang notiert.<br /><br />2. festbuchungen sind f&uuml;r beide seiten verbindlich. sie sind auf verlangen des kunden durch die agentur unverz&uuml;glich schriftlich zu best&auml;tigen unter angabe der wesentlichen einzelheiten.die agentur hat das recht auch vom kunden eine schriftliche buchungsbestaetigung zu verlangen.</p><p>3. wetterbedingte buchungen sind nur am aufenthaltsort des fotomodells m&ouml;glich und m&uuml;ssen ausdr&uuml;cklich als solche bezeichnet werden. soweit nicht anders vereinbart, handelt es sich hierbei um sch&ouml;nwetterbuchungen.<br /><br />liegen die wetterbedingungen nicht vor oder ist die wetterlage unklar, kann der kunde die buchung gegen&uuml;ber der agentur bis sp&auml;testens eine stunde vor dem vereinbarten arbeitsgebiet absagen. f&uuml;r diesen fall betr&auml;gt das ausfallhonorar 100 % des vereinbarten gesammthonorars sofern kein ersatztermin genannt wird. bereits bezahlte spesen oder reisekosten oder<br /> umbuchungsgeb&uuml;hren gehen vollumf&auml;nglich zulasten des kunden.<br /><br />4. buchungen im zusammenhang mit pornographischen darstellungen sind nicht zul&auml;ssig. der kunde verpflichtet sich die privatsph&auml;re des modells zu respektieren und zu sch&uuml;tzen. dem kunden ist es untersagt, pers&ouml;nliche daten, adressen oder telefonnummern der modelle in irgendeiner form zu speichern oder an dritte weiterzugeben.<strong><br /><br />annullierung</strong><br />1. eine festbuchung kann aus wichtigem grund annulliert werden. einen wichtigen grund zur annullierung stellen auch umst&auml;nde dar, die eine durchf&uuml;hrung der festbuchung wirtschaftlich unzumutbar machen. die annullierung ist der agentur unverz&uuml;glich mitzuteilen.<br /><br />2. die annullierung hat so viele werktage vor arbeitsbeginn zu erfolgen, wie arbeits- und reisetage gebucht worden sind, mindestens jedoch 3 werktage.<br /><br />3. erfolgt die annullierung vor 12 uhr mittags, so ist dieser tag bei der berechnung mitzuz&auml;hlen. samstag und sonntag sind keine werktage. es gilt zentraleurop&auml;ische zeitrechnung.<br /><br />4. tages- und stundenbuchungen sind 24 stunden vor arbeitsbeginn zu annullieren. erfolgt die annullierung durch das fotomodell, wird die agentur sich nach besten kr&auml;ften bem&uuml;hen, gegebenenfalls unter einschaltung anderer agenturen, f&uuml;r den kunden einen ad&auml;quaten ersatz zu finden. die agentur kann nicht f&uuml;r, durch die annullation entstandene kosten haftbar gemacht werden.<br /><br />5. erfolgt eine annullierung durch den kunden nicht rechtzeitig oder ohne wichtigen grund, ist das vereinbarte fotomodellhonorar zu bezahlen.<strong><br /><br />arbeitszeit</strong><br />1. bei einer tagesbuchung betr&auml;gt die arbeitszeit 8 stunden, bei einer halbtagesbuchung 4 stunden. soweit nicht anders vereinbart, dauert die arbeitszeit einer tagesbuchung von 9.00 uhr bis 18.00 uhr mit einer stunde mittagspause.<br /><br />2. die arbeitszeit beginnt mit dem eintreffen des fotomodell am vereinbarten arbeitsort beim kunden zur vereinbarten zeit. vorbereitungen wie make-up und frisur z&auml;hlen zur arbeitszeit.<br /><br />3. nachtarbeit zwischen 20:00 &ndash; 24:00 werden mit 150% verrechnet, zwischen 24:00 und 6:00 sowie sonntagsarbeit werden mit 200% in rechnung gestellt. diese zuschl&auml;ge sind bestandteil der buchungsbest&auml;tigung.<br /><br />4. &uuml;berstunden werden mit 150% des vereinbarten tageshonorars pro angefangene stunde verg&uuml;tet. eine &uuml;berschreitung der arbeitszeit bis zu 30 minuten wird aus kulanz nicht berechnet.<br /><br />5. die gemeinsame an- und abreise von fotomodell und kunde zwischen hotel und arbeitsort (location) z&auml;hlt zur arbeitszeit. an- und abreise (zusammen) bis zu einer stunde pro tag werden aus kulanz nicht berechnet. reisezeit von wird mit 50% des tageshonorars verrechnet.<strong><br /><br />fotomodellhonorar</strong><br />1. das fotomodellhonorar umfa&szlig;t das tageshonorar f&uuml;r die arbeitszeit des modells. zzgl. der agenturprovision sowie anfallender mwst</p><p>2. modetarif: hierzu z&auml;hlen s&auml;mtliche aufnahmen von bekleidung und zur mode geh&ouml;rige accessoires (nachtwache, schmuck, str&uuml;mpfe, schuhe, frisuren,brillen etc.), die in verbindung mit mode gestaltet werden, soweit es sich nicht um werbung handelt.<br /><br />3. editorial: einmalige ver&ouml;ffentlichungen in printmedien, wie zum beispiel redaktionelle modestrecken ohne produktwerbung in zeitschriften. es gelten die besonderen honorarvereinbarungen mit den verlagsh&auml;usern und der agentur. jede erneute ver&ouml;ffentlichung gilt als neue buchung und wird zu den vereinbarten ans&auml;tzen verrechnet.<br /><br />4. sonderhonorar: miederwaren, tagw&auml;sche, akt, konsumg&uuml;terwerbung, sowie einzelne k&ouml;rperteile wie h&auml;nde f&uuml;&szlig;e etc., allgemeine werbung mit aufnahmen zum modetarif und werbefilme bed&uuml;rfen einer gesonderten vereinbarung.<br /><br />5. halbtags- und stundenbuchungen: das fotomodellhonorar bei halbtagsbuchungen betr&auml;gt bei am arbeitsort ans&auml;ssigen fotomodellen mindestens 60 % des &uuml;blichen tageshonorars. halbtagsbuchungen von anreisenden fotomodellen und stundenbuchungen bed&uuml;rfen immer einer gesonderten vereinbarung.<br /><br />6. tests und layoutshootings, sind arbeiten ohne wiedergebrachte. der kunde verpflichtet sich die agentur vor jedwelcher ver&ouml;ffentlichung ein schriftliches einverst&auml;ndnis einzuholen.<strong><br /><br />reisekosten und spesen</strong><br />1. reisetageersatz: buchungen im raum z&uuml;rich (zone 10) sind spesenfrei. die an- und abreise des fotomodells zum und vom arbeitsort wird nur verg&uuml;tet, wenn sie ganz oder teilweise w&auml;hrend der &uuml;blichen arbeitszeit von fotomodellen erfolgt. die verg&uuml;tung der reisezeit ist 50% des tageshonorars bei mehr als 5 stunden anfahrtszeit.<br /><br />2. reisespesen: bei am arbeitsort ans&auml;ssigen oder nicht angereisten fotomodellen werden &uuml;bernachtungs- und verpflegungskosten nicht erstattet. taxikosten werden, halbtags- und stundenbuchungen ausgenommen, nur ab stadtgrenze erstattet. bei gemeinsamen reisen werden ab flughafen/bahnhof des abreisenden fotomodells die entstandenen reise- verpflegungs- und &uuml;bernachtungskosten vom kunden getragen. die erstattung erfolgt entweder pauschal nach den steuerlichen richts&auml;tzen pro arbeitstag oder gegen vorlage der belege. ist das fotomodell f&uuml;r mehrere kunden am arbeitsort t&auml;tig, so sind die entstandenen kosten den jeweiligen arbeitstagen entsprechend aufzuteilen.<br /><br />3. kunden sind f&uuml;r mahlzeiten bei ganztagesbuchungen verantwortlich.<br /><br /><strong>zahlungskonditionen</strong><br />das fotomodellhonorar einschlie&szlig;lich ausfallhonorar, reisetageersatz und reisespesen ist nach 20 tage rechnungserhalt rein netto zu bezahlen. der kunde oder dessen vertreter, bleiben das honorar schuldig auch wenn er im namen und auftrag von drittpersonen handelt. alle zahlungen haben in der auf der buchungsbest&auml;tigung/rechnung vereinbarten w&auml;hrung zu erfolgen.<strong><br /><br /><br /><br /><br />reklamationen, haftung</strong><br />1. bei reklamationen hat der kunde umgehend die agentur zu informieren und die reklamationsgr&uuml;nde darzulegen. reklamationen muessen w&auml;hrend der arbeitszeit erfolgen und nicht am naechsten tag. es sind polaroidfotos zum nachweis der reklamation zu erstellen. sodann ist das fotomodell ausdr&uuml;cklich von seiner arbeitspflicht zu entbinden. f&uuml;r hairstylist, styling und make-up ist das fotomodell nicht verantwortlich. bei reklamationen, die vom kunden nachgewiesen werden, entf&auml;llt jegliche zahlungspflicht f&uuml;r dieses fotomodell,<br />ist das modell auf wunsch des kunden angereist, so hat sich der kunde die reisekosten zu &uuml;bernehmen. wurden mit dem fotomodell dennoch aufnahmen zur ver&ouml;ffentlichung gemacht, so gilt dies als verzicht des kunden auf jegliche reklamation.<br /><br />2. kann produziertes material aus technischen, &auml;sthetischen, politischen oder religi&ouml;sen bzw. ethischen gr&uuml;nden nicht verwendet werden, so kann das modell/agentur nicht haftbar gemacht werden.<br /><br />3. bei schuldhafter versp&auml;tung des fotomodells (verschlafen, verpa&szlig;tes flugzeug etc.) hat das fotomodell entsprechend l&auml;nger zu arbeiten. ist dies aufgrund besonderer umst&auml;nde nicht oder nur teilweise m&ouml;glich, so verliert das fotomodell seinen anteiligen tageshonoraranspruch auf der grundlage des &uuml;berstundenhonorars.<br /><br />4. bei besonders risikoreichen aufnahmen hat der kunde eine entsprechende versicherung f&uuml;r das fotomodell abzuschlie&szlig;en. ist der agentur das einzugehende risiko bei der buchung nicht ausdr&uuml;cklich mitgeteilt worden, ist das fotomodell berechtigt, seine leistung zu verweigern und erh&auml;lt ein ausfallhonorar in h&ouml;he von 70 % des vereinbarten gesamthonorars.<br /><br />5. weitergehende anspr&uuml;che richten sich nach den allgemeinen gesetzlichen bestimmungen. kann produziertes material aus technischen, &auml;sthetischen, politischen oder religi&ouml;sen bzw. ethischen gr&uuml;nden nicht verwendet werden, so kann das modell und agentur nicht haftbar gemacht werden und die vereinbarten die honoraranspr&uuml;che bleiben bestehen.<br /><br />6. die haftung des fotomodells sowie seiner agentur aus jedem rechtsgrund ist auf das gesammthonorar beschr&auml;nkt, ausgenommen bei vorsatz und grober fahrl&auml;ssigkeit.<strong><br /><br />wiedergaberechte</strong><br />1. soweit nicht ausdr&uuml;cklich anders vereinbart, werden mit dem vereinbarten fotomodellhonorar die nutzungsrechte an den aufnahmen ausschlie&szlig;lich dem genannten kunden ein jahr innerhalb der schweiz f&uuml;r den vereinbarten verwendungszweck, das vereinbarte produkt und die vereinbarte nutzungsform einger&auml;umt. wenn nichts anderes vereinbart, beginnt die jahresfrist mit der tats&auml;chlichen nutzung, sp&auml;testens 2 monate nach erstellung der aufnahmen. es besteht kein anrecht auf exklusivit&auml;t des models ohne entsprechende schriftliche vereinbarung.<br /><br />2. jede weitergehende nutzung, insbesondere f&uuml;r poster, plakate, verpackungen, displays, videos, internet kataloge brosch&uuml;ren pr-material, flyer und alle grafischen und allen digitalen medien, sowie jede nutzung des fotomodellnamens, sowie exklusivit&auml;t, bedarf einer ausdr&uuml;cklichen schriftlichen einwilligung durch die agentur. eine digitale speicherung der aufnahmen ist grunds&auml;tzlich nicht gestattet und nur mit ausdr&uuml;cklicher schriftlicher einwilligung unter konkreter angabe des verwendungszwecks m&ouml;glich.<br /><br />3. nutzungsrechte werden erst durch zahlung des vereinbarten entgelts einger&auml;umt. jegliche nutzung vor vollst&auml;ndiger zahlung des vereinbarten entgelts ist unzul&auml;ssig.<br /><br />sollten die aufnahmen des models ohne wissens der agentur trotzdem fur werbezwecke ver&ouml;ffentlicht werden, so haftet der kunde/fotograf finanziell fur den entstandenen schaden, und muss fur jede einzelne ver&ouml;ffentlichung ein honorar bezahlen. <strong><br /><br />schlussbestimmungen</strong><br />1. zwischen den parteien dieser buchungsbedingungen, agentur, kunde und fotomodell, findet ausschliesslich schweizer recht anwendung. erf&uuml;llungsort f&uuml;r alle verpflichtungen aus der buchung im zusammenhang mit nutzungsrechten ist z&uuml;rich.<br /><br />2. der kunde verpflichtet sich, &auml;nderungen oder erg&auml;nzungen der buchungen und abweichungen von diesen buchungsbedingungen nur nach vorheriger absprache mit der agentur vorzunehmen und es zu unterlassen fotomodelle w&auml;hrend der arbeitstage zu buchungs&auml;nderungen oder buchungserg&auml;nzungen anzuhalten. f&uuml;r die g&uuml;ltigkeit dieser &auml;nderungen muss eine schriftliche best&auml;tigung der agentur vorliegen.<br /><br />3. der kunde verpflichtet sich keine privaten daten der modelle, adressen und telefonnummern abzuspeichern, zu ver&ouml;ffentlichen, zu verkaufen oder in irgendeiner form an dritte personen weiterzugeben. kontaktaufnahme muss ausschlie&szlig;lich &uuml;ber die agentur erfolgen.<br /><br />4. die g&uuml;ltigkeit der buchungsbedingungen wird durch die etwaige ung&uuml;ltigkeit einzelner bestimmungen nicht ber&uuml;hrt. an stelle einer unwirksamen bestimmung gilt das jenige als vereinbart, was dem angestrebten zweck m&ouml;glichst nahe kommt. entsprechendes gilt f&uuml;r die auff&uuml;llung von vertragsl&uuml;cken.<strong><br /><br /><br /><br />FOTOGEN AG 2007</strong> </p>', '<p>modell zu sein ist f&uuml;r viele ein traumberuf. vor einer kamera zu stehen, das zentrum der aufmerksamkeit zu sein, glamour und das reisen sind bestimmt die hauptbeweggr&uuml;nde modell zu werden. mit dem eigenen aussehen geld zu verdienen ist sicher reizvoll. vieles ist sch&ouml;n an diesem beruf - doch erst disziplin, ausdauer, einsatz, und ein starker wille sowie sich der gro&szlig;en konkurrenz stellen - f&uuml;hrt zum angestrebten erfolg. keine angst - fotogen wird dich immer beraten und dir stets zur seite stehen.<br /><br /><strong>welche voraussetzungen brauche ich?</strong><br />als fotogen modell kommst du in frage wenn du folgende voraussetzungen erf&uuml;llst:<br />- m&auml;dchen zwischen 14 und 21 jahren mit mindestma&szlig; 1.74 - 1.80<br />- jungs      zwischen 18 und 30 jahren mit mindestma&szlig; 1.82 - 1.89<br /><br />gesundes aussehen, gut proportionierte figur und gute haut.</p><p>&nbsp;</p><p><strong>wie kannst du dich bewerben?</strong><br />du kannst uns deine fotos-polaroids per email zusenden: <a href="mailto:newfaces@fotogen.ch">newfaces@fotogen.ch</a></p><p>die fotos sollten im jpeg-format sein und eine gr&ouml;&szlig;e von 72dpi nicht &uuml;berschreiten falls du uns deine fotos lieber per post schicken willst, drucke bitte die anmeldeformulare einfach aus. bitte lege einen ausreichend frankierten r&uuml;ckumschlag bei, wenn du deine bilder wieder retourniert haben m&ouml;chtest.bitte sende uns nur kopien von originalfotos zu. </p><p>wir ben&ouml;tigen:<br /></p><p>- m&ouml;glichst nat&uuml;rliche farbphotos z.b ferienfotos, polas, schnappsch&uuml;sse etc...<br />- mindestens eine portraitaufnahme                                                                            </p><p>- mindestens ein ganzk&ouml;rperphoto am besten im bikini oder in boxershorts<br />- wenig oder gar kein make up benutzen<br />- bitte keine akt/nacktfotos schicken<br />- kontaktadresse und telefonnummern nicht vergessen<br />- falls sedkarten und/oder proffessionelle fotos vorhanden &ndash;bitte beilegen<br /> <br /></p><p><strong>bitte benutze folgende formulare:</strong><br /></p><p><a href="doc/FOTOGENbewerbungfrau.doc.zip">bewerbungsformular weiblich</a></p><p><a href="doc/FOTOGENbewerbungmann.doc.zip">bewerbungsformular m&auml;nnlich</a></p><p>&nbsp;</p><p><strong>wie erf&auml;hrst du, ob wir interesse an dir haben?</strong></p><p> wir werden uns umgehend und schriftlich bei dir melden. deswegen ist deine telefonnummer oder e-mailadresse ganz wichtig. falls wir uns innerhalb von 14 tagen nicht bei dir melden, dann rufe uns bitte an.<br /><br /><br /> </p><p>&nbsp;</p><p>Fotogen AG         </p>', '<div><br /></div><div><br /></div><div><br /></div><div><br /></div><div><br /></div><div><span style="color: #0000ee; text-decoration: underline" class="Apple-style-span"><br /></span></div>', '<p><strong>ich habe ein super gesicht bin aber kleiner als 174</strong><br />wenn du die o.a. voraussetzungen nicht erf&uuml;llst, k&ouml;nnen wir dich als fotomodell nicht aufnehmen. du hast aber die moeglichkeit dich bei unserer talentabteilung face2face unter <a href="http://www.face-face.ch/" target="_blank">www.face-face.ch</a> zu bewerben. </p><p>&nbsp;</p><p><strong>kann ich als fotomodell arbeiten wenn ich noch in der schule bin</strong><br />deine ausbildung ist sehr wichtig, und soll auch zu Ende gebracht werden. in diesem fall werden wir uns bem&uuml;hen mit dir an wochenenden zu arbeiten.</p> <p>&nbsp;</p><p><strong>ich habe keine profi bilder</strong><br />um dich zu bewerben ist das auch nicht n&ouml;tig. siehe unter rubrik &quot;become a model&quot; <br /> </p> <p>&nbsp;</p><p><strong>kann ich eine freundin/freund/schwester/bruder anmelden</strong><br />ja das kannst du. Bitte verwende unsere bewerbungsformulare.<br /></p><p> <br /><strong>man h&ouml;rt immer von traumgagen. was sind denn die verdienstm&ouml;glichkeiten f&uuml;r fotomodelle</strong><br />die modellgagen sind davon abh&auml;ngig auf welcher karrierestufe sich ein model befindet. je mehr redaktionelle auftr&auml;ge ein modell macht - d.h. aufnahmen die in renommierten modezeitschriften ver&ouml;ffentlicht werden, umso h&ouml;her steigt ihre tagesgage f&uuml;r kataloge und werbeauftraege. die honorare f&uuml;r redaktionelle auftraege bewegen sich zwischen 50fr bis 500fr. fotomodelle mit berufserfahrung und guten portfolios verdienen tagesgagen zwischen 500fr bis 8000fr. es gibt auch wenige starmodelle die mehr verdienen wie claudia schiffer, naomi campbell etc...</p> <p>&nbsp;</p><p><strong>wie lange brauche ich um die n&ouml;tige berufserfahrung zu sammeln</strong><br />die aufbauzeit liegt bei ca.12 monaten und noch l&auml;nger falls du noch die schule besuchst. ausschlaggebend sind jedoch disziplin, einsatz und ausdauer eines jeden einzelnen.<br /> </p> <p>&nbsp;</p><p><strong>wie erkenne ich unseri&ouml;se agenturen, und wie gehe ich damit um</strong><br />es gibt auch in unserer branche schwarze schafe. am besten h&auml;lt man sich von so genannten modellausbildungen fern, die sehr viel geld im voraus verlangen. auch agenturen die dir gro&szlig;e karriere versprechungen machen, obwohl du nicht die voraussetzungen erf&uuml;llst. in der schweiz gibt es keinen verband, der dir auskunft geben kann. wir empfehlen dir daher, dich bei bekannten zeitschriften &uuml;ber agenturen zu erkundigen, oder z.b mit deinen eltern mehrere agenturen zu besuchen. so kannst du dir einen guten eindruck verschaffen.</p><p>&nbsp;</p><p><strong>FOTOGEN AG </strong></p><p><strong> </strong></p><strong><br /> </strong><p><strong> </strong></p><p>&nbsp;</p><p><span style="font-weight: bold" class="Apple-style-span"><br /></span></p>', '<p>unsere eventabteilung plant und organisiert f&uuml;r sie in der ganzen schweiz veranstaltungen in den bereichen mode und entertainment. wir k&ouml;nnen dabei auf unsere langj&auml;hrige erfahrung und hervorragende kontakte zur&uuml;ckgreifen, was uns immer wieder erm&ouml;glicht, umwerfende parties und unvergessliche modeschauen auf die beine zu stellen.<br /><br />unsere abteilung bietet folgende dienstleistungen an: konzeption, planung und durchf&uuml;hrung, sowie sponsoringsuche, presse und medienmitteilungen, medienpr&auml;senz und die nachbearbeitung des events.<br /><br />weitere parties werden mehrmals pro jahr organisiert und bringen spezifisch unsere nachwuchsmodelle mit den profis der kommunikations-, werbe- und modebranche zusammen und erm&ouml;glichen unserer kundschaft die newcomer kennenzulernen. ebenso kommen interessante und produktive kontakte zwischen den fotografen und den kunden zustande.</p>', '<p><strong>FOTOGEN AG</strong><br />dufourstrasse 1<br />8008 z&uuml;rich<br />switzerland<br /><br />tel +41(0)44 268 90 90</p><p>fax +41(0)44 268 90 99<br /></p><p><br /><a href="mailto:office@fotogen.ch">office@fotogen.ch</a><br /><a href="mailto:women@fotogen.ch">women@fotogen.ch</a><br /><a href="mailto:men@fotogen.ch">man@fotogen.ch</a><br /><br /><a href="mailto:accounting@fotogen.ch">accounting@fotogen.ch</a><br /><a href="mailto:newfaces@fotogen.ch">newfaces@fotogen.ch</a><br /><a href="mailto:graphik@fotogen.ch">graphik@fotogen.ch</a><br /><a href="mailto:scouting@fotogen.ch">scouting@fotogen.ch</a><br /><a href="mailto:party@fotogen.ch">party@fotogen.ch</a><br /><br />www.fotogen.ch<br />www.fotogen.com<br /><br /> <br /></p><div><br /></div><p>&nbsp;</p>', '<p><strong>vom flughafen zuerich:</strong><br />nehmen sie einen zug zum &quot;zuerich hauptbahnhof&quot;.von dort aus koennen sie die <br />tram nummer 4 in richtung &quot;tiefenbrunnen&quot; nehmen und an der station &quot;opernhaus&quot; <br />aussteigen. vor ihnen sehen sie die kreuzung &quot;falkenstrasse&quot;, die sie nach rechts <br />nehmen, in richtung zuerich see. nach ca.50 meter sehen sie an der linken seite <br />die &quot;dufourstrasse&quot;. wir sind an der nummer 1 im 4ten stockwerk &uuml;ber dem conti <br />restaurant und hinter zuerichs opernhaus am bellevue.sie koennen auch den zug <br />vom hauptbahnhof direkt bis &quot;stadelhofen&quot; nehmen. <br /> </p><p>&nbsp;</p><p><img src="../uploaded_imgs/lageplan_fotogen.gif" alt="" /></p><p>&nbsp;</p><p><strong>from airport z&uuml;rich: </strong><br />please take the train to &quot;z&uuml;rich hauptbahnhof&quot; from there you can either take the tram number 4 towards &quot;tiefenbrunnen&quot; and get off at &quot;opernhaus&quot;. the crossing in front of you is  &quot;falkenstrasse&quot;take it to the right towards the lake.after 50 meters you will see another street leading to your left called &quot;dufourstrasse&quot;. <br />here you are at dufourstraase 1 at the 4th floor over the conti restaurant and behind zuerichs opera house at bellevue.you can also take the train from hauptbahnhof to &quot;stadelhofen&quot;and walk 5 minutes to the agency.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '<p align="left"><em><strong><br /></strong></em></p>');
